version: "1"

package:
  id: org.deepin.editor
  name: "deepin-editor"
  version: 6.5.17.1
  kind: app
  description: |
    editor for deepin os.

base: com.uniontech.base/25.2.0
runtime: com.uniontech.runtime.dtk/25.2.0

command:
  - deepin-editor

build: |
  bash ./install_dep linglong/sources "${PREFIX}"

  # 修改路径
  sed -i "s|/usr|$(echo $PREFIX)|g" ${PREFIX}/lib/${TRIPLET}/cmake/DFrameworkdbus/DFrameworkdbusConfig.cmake
  sed -i 's|set(QT_LRELEASE "/lib/qt${QT_VERSION_MAJOR}/bin/lrelease")|set(QT_LRELEASE "lrelease")|g' cmake/translation-generate.cmake

  # 构建
  VERSION=$(head -1 debian/changelog | awk -F'[()]' '{print $2}')
  cmake -B build ${conf_args} \
        -DCMAKE_SAFETYTEST_ARG="CMAKE_SAFETYTEST_ARG_OFF" \
        -DCMAKE_BUILD_TYPE=Release \
        -DCMAKE_INSTALL_PREFIX="${PREFIX}" \
        -DVERSION=${VERSION}
  cmake --build build -j`nproc`
  cmake --build build --target install > install.log 2>&1

  # 项目生成应用名和动态隐式加载的依赖库，ldd无法找到的其他库
  LDD_FILES=(
    deepin-editor
    libdeepin-event-log.so
    libzpdcallback.so
  )

  # 生成.install 文件
  bash ./deploy_dep "${LDD_FILES[@]}"

